import React from "react";
import Container from "./Container";
import styles from "./ErrorModal.module.css";

const ErrorModal = (props) => {
  return (
    <div className={styles.background}>
      <Container>
        <div>
          <h1>{props.error.title}</h1>
        </div>
      </Container>
    </div>
  );
};

export default ErrorModal;
